smashing beakers 🤝  smashing the patriarchy
@richamoorjani "Women of color like myself are constantly told to “keep our heads down” and to be grateful for what we have, and for us to ask for what we deserve can seem terrifying and impossible at times. Smashing that beaker was incredibly cathartic for me as the actor playing Kamala, and I look forward to having a moment like that in my own life."
📸  @itsyasara
